pragma solidity ^0.8.0;
import "../../../interfaces/IContractCertified.sol";
import "../../../interfaces/IContractWithId.sol";

contract ContractCertified is IContractCertified {
    IContractCertifier private _certifier;

    constructor(IContractCertifier certifier) {
        _certifier = certifier;
    }

    function supportsInterface(bytes4 interfaceId)
        public
        view virtual
        returns (bool)
    {
        return interfaceId == type(IERC165).interfaceId || interfaceId == type(IContractCertified).interfaceId;
    }

    function getCertifier() public view returns (IContractCertifier) {
        return _certifier;
    }
}

abstract contract ContractCertifier is IContractCertifier {

    SContractWithId[] private _certifiedcontracts;

    function isTrustedCertifier(address certifier_) public view virtual returns (bool);

    function isContractCertified(
        address contractAddr_,
        uint256 contractId_
    ) public view virtual returns (bool) {
        uint i = _certifiedcontracts.length;
        for (;i>0;i--)
             if ((_certifiedcontracts[i-1].contractAddr==contractAddr_&&_certifiedcontracts[i-1].contractId==0) 
                ||
                (_certifiedcontracts[i-1].contractAddr==contractAddr_&&_certifiedcontracts[i-1].contractId==contractId_))
                return true;
        return false;
    }

    function contractCertifiedAdded(address contractAddr_,uint256 contractId_) internal virtual {}

    function contractCertifiedRemoved(address contractAddr_,uint256 contractId_) internal virtual {}

    function _addContractCertified(address contractAddr_,uint256 contractId_) internal returns (bool){
        for (uint i = _certifiedcontracts.length;i>0;i--)
            if (_certifiedcontracts[i-1].contractAddr==contractAddr_&&_certifiedcontracts[i-1].contractId==0)
                return false;
        if (contractId_==0)
        {
            while (true)
            {
                uint i = _certifiedcontracts.length;
                for (;i>0;i--)
                    if (_certifiedcontracts[i-1].contractAddr==contractAddr_)
                    {
                        _removeContractCertified(_certifiedcontracts[i-1].contractAddr,_certifiedcontracts[i-1].contractId);
                        break;
                    }
                if (i==0)
                    break;
            }
        }
        else
            for (uint i = _certifiedcontracts.length;i>0;i--)
                if (_certifiedcontracts[i-1].contractAddr==contractAddr_&&_certifiedcontracts[i-1].contractId==contractId_)
                    return false;
        _certifiedcontracts.push(SContractWithId(contractAddr_,contractId_));
        contractCertifiedAdded(contractAddr_,contractId_);
        return true;
    }

    function _removeContractCertified(address contractAddr_,uint256 contractId_) internal returns (bool){
        uint _len = _certifiedcontracts.length;
        for (uint i;i<_len;i++)
            if (_certifiedcontracts[i].contractAddr==contractAddr_&&_certifiedcontracts[i].contractId==contractId_)
            {
                if (i<_len-1)
                    _certifiedcontracts[i] = _certifiedcontracts[_len-1];
                _certifiedcontracts.pop();
                contractCertifiedRemoved(contractAddr_,contractId_);
                return true;
            }
        return false;
    }

    function supportsInterface(bytes4 interfaceId)
        public virtual
        view 
        returns (bool)
    {
        return interfaceId == type(IERC165).interfaceId || interfaceId == type(IContractCertifier).interfaceId;
    }


    function certify(
        IContractCertified contractAddr_,
        uint256 contractId_
    )
        public
        view
        returns (bool)
    {
        if (isContractCertified(address(contractAddr_),0))
            return true;
        if (contractId_!=0)
        if (isContractCertified(address(contractAddr_),contractId_))
            return true;
        IContractCertifier certifier = contractAddr_.getCertifier();
        if (!isTrustedCertifier(address(certifier)))
            return false;
        return certifier.certify(contractAddr_,contractId_);
    }
}
